import React from 'react'
import styleUtils from '../styles/utils.module.css'


interface Props {
    wrongLetters: string[];
  }

  export default function WrongLetters({ wrongLetters }: Props) {
    return (
      <div className={styleUtils.wrongLettersContainer}>
        <div>
          {wrongLetters.length > 0 && <p>Wrong</p>}
          {wrongLetters
            .map((letter: string, i: number) => <span key={i}>{letter}</span>)
            .reduce((prev: string | JSX.Element | null, curr: string | JSX.Element) =>
              prev === null ? [curr] : [prev, ', ', curr], null)}
        </div>
      </div>
    );
  }
